#include <stdio.h>

int main()
{	
	int i,a,b,j,temp;
	scanf("%d",a);
	int nums[a] = {};
	for(i=0;i<a;i++)
	{scanf("%d",&nums[i+1]);
	   }   
	for(i=0;i<a-1;i++)
	{
		for(j=0;j<a-i-1;j++)
		{	
			if(nums[j]<nums[j+1])
			temp = nums[j];
			nums[j] = nums[j+1];
			nums[j+1] = temp; 
		}
	}
	for(i=0;i<a;i++)
	{
	printf("%d\t",nums[i]);
	}
	return 0; 
}

#include<stdio.h>
